import React from 'react';
import './Sobre.css';

function Sobre() {
  return (
    <>
      <h1>Sobre Mim</h1>
      <p>
      Sou apaixonado por tecnologia e desenvolvimento, com experiência em projetos práticos que vão desde sistemas embarcados com ESP32 e Arduino até o desenvolvimento de aplicações web. Gosto de aprender de forma autodidata e também valorizo o conhecimento adquirido em cursos e projetos colaborativos.
      </p>
      <p>Aqui você pode conhecer um pouco mais sobre mim e meu trabalho.</p>
    </>
  );
}

export default Sobre;
